import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
    const navStyle = {
        display: 'flex',
        gap: '1rem',
        padding: '1rem',
        background: '#282c34',
        color: 'white'
    };

    const linkStyle = {
        color: 'white',
        textDecoration: 'none',
        fontWeight: 'bold'
    };

    return (
        <nav style={navStyle}>
            <Link to="/dashboard" style={linkStyle}>Dashboard</Link>
            <Link to="/ships" style={linkStyle}>Ships</Link>
            <Link to="/components" style={linkStyle}>Components</Link>
            <Link to="/jobs" style={linkStyle}>Jobs</Link>
            <Link to="/jobcalendar" style={linkStyle}>Calendar</Link>
        </nav>
    );
};

export default Navbar;
